import './App.css';
import StudentForm from './components/StudentForm';
import StudentList from './components/studentList';



class App extends Component {
  render() {
    return (
    <div className="App">
      <div className="navbar navbar-ligth bg-primary">
        <a className="text-white" href="/">Tennis App</a>
      </div>
      <div className="container">

           <div className="col-md-5 mx-auto m-5 ">
             <StudentForm/>


           </div>
           <div id="Students-list" className="col-md-7">
           <StudentList/>
          </div> 

      </div>

    </div>
    );
  }
}

export default App;
